    const sheetSelect = document.getElementById("sheetSelect");
    const searchBox = document.getElementById("searchBox");
    const tableContainer = document.getElementById("tableContainer");

    const sheetNames = Object.keys(data);
    sheetNames.forEach(name => {
      const option = document.createElement("option");
      option.value = name;
      option.textContent = name;
      sheetSelect.appendChild(option);
    });

    function renderSheet(sheetName) {
      const rows = data[sheetName];
      if (!rows || rows.length === 0) {
        tableContainer.innerHTML = "<p>‡§ï‡•ã‡§à ‡§°‡•á‡§ü‡§æ ‡§®‡§π‡•Ä‡§Ç ‡§Æ‡§ø‡§≤‡§æ</p>";
        return;
      }

      let html = "<table><thead><tr>";
      const headers = Object.keys(rows[0]);
      headers.forEach(function(h) {
        html += '<th>' + h + '</th>';
      });
      html += "</tr></thead><tbody>";
      rows.forEach(function(row) {
        html += "<tr>";
        headers.forEach(function(h) {
          html += "<td>" + row[h] + "</td>";
        });
        html += "</tr>";
      });
      html += "</tbody></table>";
      tableContainer.innerHTML = html;
    }

    sheetSelect.addEventListener("change", () => {
      renderSheet(sheetSelect.value);
    });

    searchBox.addEventListener("input", () => {
      const term = searchBox.value.toLowerCase();
      const rows = tableContainer.querySelectorAll("tbody tr");
      rows.forEach(row => {
        const match = Array.from(row.cells).some(cell => cell.textContent.toLowerCase().includes(term));
        row.classList.toggle("hide", !match);
      });
    });

    function exportToCSV() {
      const sheet = data[sheetSelect.value];
      const headers = Object.keys(sheet[0]);
      const csvRows = [
        headers.join(","),
        ...sheet.map(row => headers.map(field => `"${row[field]}"`).join(","))
      ];
      const blob = new Blob([csvRows.join("\n")], { type: 'text/csv;charset=utf-8;' });
      const url = URL.createObjectURL(blob);
      const a = document.createElement("a");
      a.href = url;
      a.download = sheetSelect.value + ".csv";
      a.click();
    }

    // Auto-load first sheet
    renderSheet(sheetSelect.value = sheetNames[0]);
  </script>
